import React from 'react';

import './css/index.css';
import './css/catalog.css';
import './css/catalog1.css';
import './css/catalog2.css';
import './css/catalog4.css';
import './css/catalog5.css';
import './css/catalog6.css';


import Header from "./Header";
import ThreeProduct from "./catalaug-3-product/ThreeProduct";
import FourProducts from "./catalaug-4-product/FourProducts";
import TopSlide from "./top-slider/TopSlide";
import TwoCard from "./two-card/TwoCard";
import ThreeCards from "./Three-card/ThreeCards";
import ThreeProductData from "./ThreeProductData"


function App(props){
return(
<>

    <Header></Header>
    <TopSlide></TopSlide>
    
    {ThreeProductData.map(AllCatalogAutomatic)}


</>
);
}

export default App;
